import React, { Component } from 'react';
export default class About extends Component {
  render() {
    let resumeData = this.props.resumeData;
    return (
      <section id="about">
        <div className="twelve columns header-col" id="About-Me">
          <h1><span style={{ color: "white", fontSize: "18px" }}>About me</span></h1>
        </div>
         <div className="row">
            <div className="four columns">
               <img className="profile-pic"  src="images/profpic.jpeg" alt="" />
            </div>
            <div className="seven columns main-col">
               <p>
               {
                 resumeData.aboutme
               }
               </p>

            </div>
         </div>
      </section>
    );
  }
}
